sources.scss\\button.scss:
.button {
    font-weight: normal;
    font-size: 22px;
    line-height: 30px;
    color: #FFFFFF;
    padding: 12px 37px;
    border-radius: 0;
    background-color: transparent;
    border: 2px solid #fff;
    position: relative;
    overflow: hidden;
    cursor: pointer;


    &:after,
    &:before {
        content: '';
        display: block;
        background-color: $base-green;
        height: 100%;
        width: 100%;
        top: 0;
        position: absolute;
        transition: ease-in-out .2s;
        z-index: 1;
    }

    &:after {
        transform: translateX(100%);
        right: 0;
    }

    &:before {
        transform: translateX(-100%);
        left: 0;
    }

    span {
        position: relative;
        z-index: 2;
    }

    &:hover {

        &:after,
        &:before {
            transform: translateX(0);
        }
    }

    &_green {
        border: 2px solid $base-green;
        background-color: $base-green;
        transition: all ease-out .2s;

        &::after,
        &::before {
            display: none;
        }

        &:hover {
            background-color: darken($base-green, 10%);
        }
    }
}

