        display: flex;
        align-items: center;
        padding-bottom: 16px;
        text-decoration: none;
        transition: ease-in-out .2s;

        &:hover {
            transform: translateX(3px);
        }

        &:first-child {
            margin-bottom: 22px;
            border-bottom: 1px solid rgba(255, 255, 255, 0.1);
        }
    }

    &__news-img {
        margin-right: 19px;
        max-height: 64px;
        object-fit: cover;
        object-position: center;
    }

    &__news-date {
        font-weight: normal;
        font-size: 15px;
        line-height: 22px;
        color: $base-green;
    }

    &__news-desc {
        font-weight: normal;
        font-size: 14px;
        line-height: 19px;
        color: #FFFFFF;
    }

    &__bottom {
        padding: 21px 0;
        border-top: 1px solid rgba(255, 255, 255, 0.1);
        font-weight: normal;
        font-size: 14px;
        line-height: 19px;
        color: #FFFFFF;

        .container {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }
    }

    &__bottom-list {
        display: flex;
        margin: 0;
        padding: 0;

        a {
            text-decoration: none;
            color: inherit;
        }
    }

    &__bottom-list-item {
        padding: 0;
        margin: 0;
        list-style: none;
        margin-right: 26px;

        &:last-child {
            margin-right: 0;
        }
    }
}

