.welcome {
    position: relative;

    &:after {
        content: '';
        display: block;
        position: absolute;
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        background: linear-gradient(0deg, rgba(0, 0, 0, 0.65), rgba(0, 0, 0, 0.65));
    }

    &__wrap {
        position: relative;
        z-index: 1;
        padding-top: 52px;
    }

    &__title {
        font-weight: 300;
        font-size: 35px;
        line-height: 48px;
        text-transform: uppercase;
        color: #FFFFFF;
        text-align: center;
    }

    &__title-big {
        font-weight: bold;
        font-size: 45px;
        line-height: 61px;
        position: relative;

        &:after {
            content: '*';
            position: absolute;
            right: -0.7em;
            top: -0.4em;
        }
    }

    &__separator {
        display: flex;
        justify-content: space-between;
        margin-top: 26px;

        div {
            flex: auto;
            background-color: $base-green;
            height: 30px;
        }

        &::after,
        &::before {
            content: '';
            border-top: 30px solid #476200;
        }

        &::after {
            border-right: 30px solid transparent;
        }

        &::before {
            border-left: 30px solid transparent;
        }
    }

    &__subtitle {
        font-weight: 300;
        font-size: 35px;
        line-height: 48px;
        text-transform: uppercase;
        color: #FFFFFF;
        margin-top: 28px;
        text-align: center;
    }

    &__actions {
        margin-top: 32px;
        text-align: center;
    }
    
    &__btn {
        font-size: 30px;
        line-height: 41px;
        padding: 9px 22px;
    }

    &__catalog {
        margin-right: 16px;
    }
}
